import { AccountBookOutlined,CarOutlined,InsuranceOutlined,SkinOutlined } from '@ant-design/icons'

const serviceData = [
  {
    icon: <SkinOutlined />,
    title: "品类齐全，轻松购物",
    subtitle: "全齐乐购",
    bg: "#fdefe6",
  },
  {
    icon: <CarOutlined />,
    title: "多仓直发，极速配送",
    subtitle: "直发速达",
    bg: "#ceebe9",
  },
  {
    icon: <InsuranceOutlined />,
    title: "正品行货，精致服务",
    subtitle: "正品精致",
    bg: "#e2f2b2",
  },
  {
    icon: <AccountBookOutlined />,
    title: "天天低价，畅选无忧",
    subtitle: "低价畅选",
    bg: "#d6e5fb",
  },
];

export default serviceData;
